import React from "react";

function Signup() {

    return (
    
            <div id="sign-up-section">
                <h2>Sign Up to Petal & Pup</h2>
                <p>For the latest on asles, new release and more...</p>
                <input type="text" class="form-control" id="sign-up-input" placeholder="Enter email address" />
                <button class="btn btn-primary" id="sign-up-button">Sign Up</button>
            </div>
                
    )
}
export default Signup;
